import '../global.css';
import AppNavbar from '../components/navbar';
import 'bootstrap/dist/css/bootstrap.min.css';

function WelcomePage() {

    return (
    <>
    <AppNavbar />
      <div className="polls-page">
        <h1>Welcome!</h1>
        <p>A typical all hands goes like this...</p>
        <p>the company holds them once a quarter or a couple times a year</p>
        <p>they're not frequent enough to be meaningful, so employees don't prioritize them</p>
        <p>the updates are vague and high-level</p>
        <p>they leave 10 minutes at the end for questions and....</p>
        <h3>crickets.</h3>
        <p>crickets are the sign of disengaged employees. </p>
      </div>
    </>
  );
}

export default WelcomePage;
